  \"2016-07-27T22:42:13.894509\",\n\t\"name\": \"organochlorine-contaminants-in-eggs-of-tern-species-and-the-western-snowy-plover-nesting-i\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Previous studies have raised concerns about
  the organochlorine pesticide concentrations in the eggs of tern species in Southern
  California including the California least tern (Sterna antillarum browni, Boardman
  1988) and Caspian tern (Sterna caspia, Ohlendorf et al. 1985). The eggs analyzed
  in this study were eggs which failed to hatch at several San Diego Bay colonies.
  All black skimmer, Caspian tern, Forster's tern, elegant tern, gull-billed tern,
  and western snowy plover eggs were from the Salt Works located in south San Diego
  Bay. One of the California least tern eggs was also collected there. The contents
  of these eggs were tested for analytes and eggshell thickness was recorded.\",\n\t\"license_title\":
